import jsPDF from 'jspdf';

export class PdfFonts {
  // TODO: This adds almost 500Kb to the browser bundle - look into making Angular split it off into another chunk.
  // From https://fonts.google.com/specimen/Roboto - Apache 2.0 licensed.
  private static readonly ROBOTO_NORMAL =
    ''; // codespell:ignore
  private static readonly ROBOTO_BOLD =
    ''; // codespell:ignore

  public static readonly DEFAULT_FONT_NAME = 'Roboto-Regular';
  public static readonly NORMAL_FONT_STYLE = 'normal';
  public static readonly BOLD_FONT_STYLE = 'bold';

  constructor(private _doc: jsPDF) {
    this._registerFont(
      'Roboto-Regular-normal.ttf',
      PdfFonts.DEFAULT_FONT_NAME,
      PdfFonts.NORMAL_FONT_STYLE,
      PdfFonts.ROBOTO_NORMAL,
    );
    this._registerFont('Roboto-Bold.ttf', PdfFonts.DEFAULT_FONT_NAME, PdfFonts.BOLD_FONT_STYLE, PdfFonts.ROBOTO_BOLD);

    console.log('Fonts', this._doc.getFontList());
  }

  private _registerFont(fileName: string, fontName: string, fontStyle: string, contents: string) {
    this._doc.addFileToVFS(fileName, contents);
    this._doc.addFont(fileName, fontName, fontStyle);
  }

  public setDefaultFont(fontStyle?: string) {
    this._doc.setFont(PdfFonts.DEFAULT_FONT_NAME, fontStyle || PdfFonts.NORMAL_FONT_STYLE);
  }
}
